import React, { Component } from 'react'
// import ListItem from '../components/ListItem';



class Complete extends Component {
    constructor(props){
        super(props)
        this.state = {
            deleted: []
          }
        this.delElem = this.delElem.bind(this)

    }
    delElem(event){
        this.props.clearTask(...this.props.list, event.target.id)
    }
    render(){
        return (
            <div className="wrapper">
                <h1>Complete</h1>
                <ul className="list-group">
                {
                    this.props.list.map((item) => {
                        return (
                            <li className="list-group-item list-group-item-info"   key={item.id}>
                                <div className="itemLi">
                                    <div className="item">
                                        <span>{ item.name } </span>
                                    </div>
                                    <div className="buttons" id={item.id}>
                                        <button id='complete' onClick={this.delElem}>DELETE</button> 
                                    </div>
                                </div>
                            </li>
                        )
                    })  
                }

            </ul>

            </div>

        )
    }

}

export default Complete
